import React from "react";

function Nav(props) {
  const { categories = [], setCurrentCategory, currentCategory } = props;

  return (
    <nav className="flex-row px-1">
      <ul className="flex-row">
        {categories.map((category) => (
          <li className="mx-2">
            <span onClick={() => categories(category.name)}>
              {category.name}
            </span>
          </li>
        ))}
      </ul>
    </nav>
  );
}

export default Nav;
